import React, {Component} from "react"
import ActionDropdown from "./ActionDropdown";


export default class AdminTableRow extends Component
{
    constructor(props) {
        super(props)
    }

    handleRowClick = (p_id) => {
        if(p_id){
            console.log(p_id)
        }
    }

    render() {
        const {
            product_id,
            name,
            price,
            category,
            brand,
            current_stock,
        } = this.props.products;

        return (
            <tr onClick={() => this.handleRowClick(product_id)}>
                <td>{this.props.rowNum}</td>
                <td>{name}</td>
                <td>{price}</td>
                <td>{category}</td>
                <td>{brand}</td>
                <td>{product_id}</td>
                <td>{current_stock}</td>
            </tr>
        )
    }
}
